import React from 'react';
import { connect } from 'react-redux';

class InputTask extends React.Component {
  render() {
    return (
      <div>
        <input></input>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return { tasks: state.tasks };
}
export default connect(mapStateToProps)(InputTask);
